B.Cs=new A.dn(57820,"MaterialIcons",null,!1)
B.KY=new A.hV("K\xf6rpertalente",B.Cs,0,"koerpertalente")
B.a1=new A.fI("MU",0,"mut")
B.y=new A.fI("IN",2,"intuition")
B.af=new A.fI("GE",5,"gewandtheit")
B.wJ=new A.ay("TAL_1","Fliegen","Dem Held ist nicht nur das Man\xf6ver gelungen, sondern er hat eine zus\xe4tzliche Aktion in dieser Runde.","Der Held st\xfcrzt ab.",B.a1,B.y,B.af,0,"fliegen")
B.a4=new A.fI("CH",3,"charisma")
B.P=new A.fI("FF",4,"fingerfertigkeit")
B.w3=new A.ay("TAL_2","Gaukeleien","Die Zuschauer sind fasziniert, halten den Trick gar f\xfcr echte Magie, und potenzielle Geldeinnahmen des Gauklers verdoppeln sich.","Der Held wird bei der Pr\xe4sentation ausgebuht, da ihm ein Missgeschick passiert (mit Jonglierkeule einen Zuschauer getroffen, mit Pyrotechnik den B\xfcrgermeister verletzt etc.).",B.a1,B.a4,B.P,1,"gaukeleien")
B.aJ=new A.fI("KK",7,"koerperkraft")
B.wK=new A.ay("TAL_3","Klettern","Ohne Schwierigkeiten und viel schneller als gew\xf6hnlich hat der Held den Aufstieg geschafft. Zuschauer halten ihn f\xfcr den besten Kletterer Deres. F\xfcr Qualit\xe4tsstufen, Vergleichs- und Sammelproben gilt: FP = doppelter FW.","Der Held rutscht ab und f\xe4llt (siehe Seite 340, Sturzschaden).",B.a1,B.af,B.aJ,2,"klettern")
B.an=new A.fI("KO",6,"konstitution")
B.wQ=new A.ay("TAL_4","K\xf6rperbeherrschung","Dem Held gelingt seine Handlung und er hat noch eine zus\xe4tzliche Aktion zur Verf\xfcgung. Und was immer der Held getan hat: Es sah elegant aus.","Der Held st\xfcrzt und erleidet Schaden (1W6 SP).",B.af,B.af,B.an,3,"koerperbeherrschung")
B.wE=new A.ay("TAL_5","Kraftakt","Der Held beeindruckt durch seine Muskelkraft alle Zuschauer und gilt fortan als einer der st\xe4rksten Aventurier. F\xfcr Qualit\xe4tsstufen, Vergleichs- und Sammelproben gilt: FP = doppelter FW.","Die Handlung des Helden misslingt v\xf6llig. Er st\xfcrzt, verhebt sich o.\xc4. und verletzt sich dabei (1W6 SP).",B.an,B.aJ,B.aJ,4,"kraftakt")
B.wu=new A.ay("TAL_6","Reiten","Das Tier macht seine Sache ausgezeichnet und wie gew\xfcnscht, der Reiter hat eine weitere Aktion zur Verf\xfcgung.","Das Tier wirft den Reiter ab und er st\xfcrzt zu Boden (siehe Seite **340**, Sturzschaden).",B.a4,B.af,B.aJ,5,"reiten")
B.ws=new A.ay("TAL_7","Schwimmen","Der Held schwimmt die Strecke in Bestzeit. F\xfcr Qualit\xe4tsstufen, Vergleichs- und Sammelproben gilt: FP = doppelter FW.","Der Held geht unter (siehe Seite 340ff., Erstickungsschaden). Grund daf\xfcr k\xf6nnte ein Wadenkrampf sein.",B.af,B.an,B.aJ,6,"schwimmen")
B.wr=new A.ay("TAL_8","Selbstbeherrschung","Es gelingt dem Helden, Schmerzen (bis Stufe III) und Ablenkungen einen ganzen Tag lang zu ignorieren.","Der Held erh\xe4lt f\xfcr die n\xe4chste Stunde 2 Stufen des Zustands *Schmerz* oder ist durch die Ablenkung *\xdcberrascht*.",B.a1,B.a1,B.an,7,"selbstbeherrschung")
B.t=new A.fI("KL",1,"klugheit")
B.wt=new A.ay("TAL_9","Singen","Der Gesang des Helden ist noch in vielen Wochen Thema seiner Zuh\xf6rer. Hat der Held sich um Geld bem\xfcht, dann nimmt er mindestens das Doppelte ein als \xfcblich. F\xfcr Qualit\xe4tsstufen, Vergleichs- und Sammelproben gilt: FP = doppelter FW.","Der Held liegt mehrere Halbt\xf6ne daneben oder vergeigt den Rhythmus. Das Lied ist eine Qual f\xfcr jeden Zuh\xf6rer, der Held wird ausgebuht.",B.t,B.a4,B.an,8,"singen")
B.wa=new A.ay("TAL_10","Sinnessch\xe4rfe","Der Held nimmt sogar kaum bemerkbare Details wahr. F\xfcr Qualit\xe4tsstufen, Vergleichs- und Sammelproben gilt: FP = doppelter FW.","Der Held nimmt etwas anderes wahr, als das, was wirklich wichtig w\xe4re. Er k\xf6nnte zum Beispiel die in der N\xe4he befindlichen Blumen riechen, daf\xfcr aber nicht den auff\xe4llig stinkenden Oger, der an ihn heranschleicht.",B.t,B.y,B.y,9,"sinnesschaerfe")
B.wv=new A.ay("TAL_11","Tanzen","Die Aufmerksamkeit der Zuschauer f\xe4llt wegen des perfekten Tanzes auf den Helden. F\xfcr Qualit\xe4tsstufen, Vergleichs- und Sammelproben gilt: FP = doppelter FW.","Der Held tritt seiner Tanzpartnerin auf die F\xfc\xdfe und verletzt sie dabei oder er st\xfcrzt und blamiert sich.",B.t,B.a4,B.af,10,"tanzen")
B.wB=new A.ay("TAL_12","Taschendiebstahl","Das Opfer hat den Diebstahlversuch nicht bemerkt und der Held hat besonders wertvolle Beute gemacht oder gleich mehrere Ziele bestohlen. F\xfcr Qualit\xe4tsstufen, Vergleichs- und Sammelproben gilt: FP = doppelter FW.","Der Held wird von umstehenden Personen oder dem Opfer beobachtet, ohne es zu bemerken, und der Diebstahlversuch misslingt. Au\xdferdem ist er *\xdcberrascht*.",B.a1,B.P,B.af,11,"taschendiebstahl")
B.wS=new A.ay("TAL_13","Verbergen","Der Held hat ein perfektes Versteck gefunden oder ist lautlos wie eine Katze. F\xfcr Qualit\xe4tsstufen, Vergleichs- und Sammelproben gilt: FP = doppelter FW.","Irgendetwas (Teller, ein M\xf6belst\xfcck) ist umgefallen.",B.a1,B.y,B.af,12,"verbergen")
B.wI=new A.ay("TAL_14","Zechen","Dem Helden gelingt es, bis zum bitteren Ende durchzuhalten, und trotzdem geht es ihm am n\xe4chsten Morgen blendend.","Der Held begeht in seinem Zustand jedwede Peinlichkeit. Er zerlegt die halbe Taverne, wacht morgens nackt auf dem Markt oder in einem fremden Bett auf, plaudert Geheimnisse an den Feind aus und kann sich danach an nichts mehr erinnern.",B.t,B.an,B.aJ,13,"zechen")
B.Ct=new A.dn(58094,"MaterialIcons",null,!1)
B.L_=new A.hV("Gesellschafts\xadtalente",B.Ct,1,"gesellschaftstalente")
B.ww=new A.ay("TAL_15","Bekehren & \xdcberzeugen","Das Opfer der \xdcberzeugungsversuche ist vollends \xfcberzeugt.","Das Opfer f\xfchlt sich vom Prediger beleidigt oder f\xfcr dumm verkauft.",B.a1,B.t,B.a4,14,"bekehrenUndUeberzeugen")
B.wg=new A.ay("TAL_16","Bet\xf6ren","Das Verf\xfchrungsopfer versucht, dem bet\xf6renden Helden alle W\xfcnsche zu erf\xfcllen.","Der Held kassiert eine schallende Ohrfeige f\xfcr seinen plumpen Anmachversuch.",B.a1,B.a4,B.a4,15,"betoeren")
B.w6=new A.ay("TAL_17","Einsch\xfcchtern","Das Gegen\xfcber des Helden ist vollkommen eingesch\xfcchtert und wird in absehbarer Zeit nichts mehr gegen den Helden unternehmen.","Anstatt eingesch\xfcchtert oder beleidigt zu sein, geschieht das Gegenteil: Das Opfer ist w\xfctend, v\xf6llig gelassen oder am\xfcsiert. Oder der Held macht sich mit seinem Gehabe v\xf6llig zum Affen.",B.a1,B.y,B.a4,16,"einschuechtern")
B.wH=new A.ay("TAL_18","Etikette","Auf der Feier ist der Held aufgrund seines Benehmens, Wortwitzes und Charmes der Mittelpunkt.","Der Held beleidigt mit seinem Verhalten eine wichtige Pers\xf6nlichkeit.",B.t,B.y,B.a4,17,"etikette")
B.vZ=new A.ay("TAL_19","Gassenwissen","Der Held entdeckt ein besonders gutes, aber g\xfcnstiges Gasthaus, erh\xe4lt mehr Informationen, als er erwartet hat, oder es gelingt ihm, einen Kontaktmann zu finden, der ihm exzellente Konditionen anbietet.","Der Held ger\xe4t in den Hinterhalt einer Bande Schurken, die ihn auspl\xfcndern wollen.",B.t,B.y,B.a4,18,"gassenwissen")
B.w4=new A.ay("TAL_20","Menschenkenntnis","Der Held durchschaut die Person komplett.","Der Held ist einer kompletten Fehleinsch\xe4tzung aufgesessen. So k\xf6nnte er beispielsweise einem L\xfcgner wirklich alles glauben, ehrlichen Leuten hingegen kein Wort.",B.t,B.y,B.a4,19,"menschenkenntnis")
B.wL=new A.ay("TAL_21","\xdcberreden","Die Person, die der Held \xfcberreden wollte, tut weit mehr als sie muss.","Die Person, die der Held \xfcberreden wollte, ist w\xfctend auf den Helden und l\xe4sst sich in n\xe4chster Zeit nicht mehr \xfcberreden.",B.a1,B.y,B.a4,20,"ueberreden")
B.vY=new A.ay("TAL_22","Verkleiden","Die Verkleidung funktioniert tadellos.","Die Kleidung wird sofort durchschaut und der Held handelt sich in der Regel \xc4rger ein.",B.y,B.a4,B.af,21,"verkleiden")
B.wd=new A.ay("TAL_23","Willenskraft","Der Held widersteht und kann von dieser Person oder Sache in n\xe4chster Zeit nicht mehr beeinflusst werden.","Der Held ist der Person, die ihn beeinflussen will, vollkommen verfallen oder f\xe4llt bei Anblick eines scheu\xdflichen D\xe4mons in Ohnmacht.",B.a1,B.y,B.a4,22,"willenskraft")
B.Cw=new A.dn(58952,"MaterialIcons",null,!1)
B.KZ=new A.hV("Naturtalente",B.Cw,2,"naturtalente")
B.w9=new A.ay("TAL_24","F\xe4hrtensuchen","Sofern die Spur nicht komplett zerst\xf6rt wurde, kann der Held ihr zielsicher bis zum Ende folgen. Er erh\xe4lt mehr Informationen als \xfcblich. T\xe4uschungsman\xf6ver wie das Verwischen der Spuren durchschaut er sofort.","Der Held verwechselt die Spur und folgt einer falschen F\xe4hrte. So trifft er vielleicht auf eine gef\xe4hrliche Kreatur oder jagt den falschen Leuten hinterher.",B.a1,B.y,B.af,23,"faehrtensuchen")
B.wN=new A.ay("TAL_25","Fesseln","Der Held hat einen stabilen Knoten gemacht. F\xfcr Qualit\xe4tsstufen, Vergleichs- und Sammelproben gilt: FP = doppelter FW.","Der Held hat einen Knoten gemacht, der sich in jeder Lage l\xf6st - oder der denkbar ung\xfcnstigsten.",B.t,B.P,B.aJ,24,"fesseln")
B.wj=new A.ay("TAL_26","Fischen & Angeln","Die Zahl der Rationen ist sehr hoch. F\xfcr Qualit\xe4tsstufen, Vergleichs- und Sammelproben gilt: FP = doppelter FW.","Der Angler f\xe4llt ins Wasser und die Angel geht verloren.",B.P,B.af,B.an,25,"fischenUndAngeln")
B.wq=new A.ay("TAL_27","Orientierung","Der Held findet den Weg ohne Schwierigkeiten selbst unter schlechtesten Bedingungen.","Der Held hat sich komplett verlaufen und bewegt sich in die falsche Richtung, was ihm jedoch nicht bewusst ist.",B.t,B.y,B.y,26,"orientierung")
B.wm=new A.ay("TAL_28","Pflanzenkunde","Der Held wei\xdf alles \xfcber die Pflanze, auch besondere Wirkungen, und kann sie doppelt so lange haltbar machen wie \xfcblich.","Der Held verwechselt die Pflanze mit einer anderen.",B.t,B.P,B.an,27,"pflanzenkunde")
B.w_=new A.ay("TAL_29","Tierkunde","Der Held wei\xdf alles \xfcber das Tier.","Der Held glaubt, etwas \xfcber das Tier zu wissen, liegt aber gef\xe4hrlich falsch (sch\xe4tzt es ungiftig ein, obwohl es sehr giftig ist, oder als Pflanzenfresser, obwohl es Fleischfresser ist).",B.a1,B.a1,B.a4,28,"tierkunde")
B.wb=new A.ay("TAL_30","Wildnisleben","Ein phantastischer Schlafplatz! Die Regeneration ist um 1 Punkt erh\xf6ht.","Das Lager wird \xfcberschwemmt oder von Ungeziefer heimgesucht.",B.a1,B.af,B.an,29,"wildnisleben")
B.Cu=new A.dn(58333,"MaterialIcons",null,!1)
B.L0=new A.hV("Wissenstalente",B.Cu,3,"wissenstalente")
B.wx=new A.ay("TAL_31","Brett- & Gl\xfccksspiel","Der Held gewinnt auf spektakul\xe4re Art und Weise. Wurde um Geld gespielt, verdoppelt sich sein Gewinn.","Der Held wird f\xe4lschlicherweise des Falschspiels verd\xe4chtigt oder hat eine Pechstr\xe4ne. Wird um Geld gespielt, verliert er mindestens den kompletten Einsatz (oder mehr).",B.t,B.t,B.y,30,"brettUndGluecksspiel")
B.wA=new A.ay("TAL_32","Geographie","Der Held kennt viele Details der Region: Herrscher, Bev\xf6lkerungszahlen, Br\xe4uche, Flussverl\xe4ufe und Br\xfccken.","Der Held erinnert sich an v\xf6llig falsche geographische Details: Einwohnerzahlen von St\xe4dten stimmen nicht, Br\xfccken befinden sich an anderer Stelle als gedacht.",B.t,B.t,B.y,31,"geographie")
B.wl=new A.ay("TAL_33","Geschichtswissen","Der Held kennt besonders viele Details \xfcber ein bestimmtes Ereignis oder eine historische Person.","Der Held kann zu diesem Thema nur falsche Informationen beitragen: er irrt sich in Daten und Ereignissen.",B.t,B.t,B.y,32,"geschichtswissen")
B.we=new A.ay("TAL_34","G\xf6tter & Kulte","Der Held hat detaillierte Einsichten in das Thema und kennt selbst spezielle Rituale, Gebetstexte oder philosophische Grundlagen.","Der Held verwechselt kultische Handlungen und Ansichten dieser Kirche mit einer anderen.",B.t,B.t,B.y,33,"goetterUndKulte")
B.wG=new A.ay("TAL_35","Kriegskunst","Der Held hat einen vortrefflichen Plan, der ihm zus\xe4tzliche Vorteile im Kampf einbringt.","Der Held begeht einen kapitalen Planungsfehler, der den Kampf zu seinen Ungunsten beeinflusst oder ihm zumindest extreme Nachteile beschert.",B.a1,B.t,B.y,34,"kriegskunst")
B.wi=new A.ay("TAL_36","Magiekunde","Der Held kennt Herkunft, wirkenden Zauber und Ausl\xf6ser eines alten Artefaktes.","Der Held hat falsche Vorstellungen und irrt sich, sodass es zu einem gravierenden Fehlurteil kommt.",B.t,B.t,B.y,35,"magiekunde")
B.wo=new A.ay("TAL_37","Mechanik","Der doppelte FW z\xe4hlt als FP.","Was immer der Held konstruieren wollte: Das Objekt ist gef\xe4hrlich oder die Konstruktion f\xe4llt in sich zusammen. Eine Falle wird mit gr\xf6\xdftm\xf6glichem Erfolg ausgel\xf6st.",B.t,B.t,B.P,36,"mechanik")
B.w2=new A.ay("TAL_38","Rechnen","Schnelle und exakte Bestimmung der L\xf6sung","Das Ergebnis ist komplett falsch, der Held aber von der Richtigkeit absolut \xfcberzeugt.",B.t,B.t,B.y,37,"rechnen")
B.wR=new A.ay("TAL_39","Rechtskunde","Der Held kennt sich mit Besonderheiten des Gesetzes aus und kann einen Plan entwickeln, es zu seinem Vorteil auszulegen.","Die Auslegung des Gesetzes ist falsch oder der Held \xfcbersieht einen wichtigen Passus.",B.t,B.t,B.y,38,"rechtskunde")
B.wF=new A.ay("TAL_40","Sagen & Legenden","Der Held kann sich an viele Details der Geschichte erinnern und kennt mehrere Varianten.","Der Held verwechselt die Geschichte mit einer anderen oder meint sich an v\xf6llig andere Details zu erinnern.",B.t,B.t,B.y,39,"sagenUndLegenden")
B.wT=new A.ay("TAL_41","Sph\xe4renkunde","Der Held erinnert sich an bemerkenswerte Details \xfcber einen einzelnen D\xe4mon oder den Weg in eine verborgene Globule.","Der Held unterliegt einer gef\xe4hrlichen Fehleinsch\xe4tzung.",B.t,B.t,B.y,40,"sphaerenkunde")
B.w1=new A.ay("TAL_42","Sternkunde","Der Held kann sehr genau die Bewegungen der Himmelsk\xf6rper berechnen.","Eine Fehleinsch\xe4tzung bei einem Horoskop, einer Mondfinsternis etc.",B.t,B.t,B.y,41,"sternkunde")
B.Cq=new A.dn(57737,"MaterialIcons",null,!1)
B.L1=new A.hV("Handwerkstalente",B.Cq,4,"handwerkstalente")
B.wc=new A.ay("TAL_43","Alchimie","Der Held wei\xdf exakt, welches Elixier er vor sich hat, welche Stufe es besitzt und wie lange haltbar es ist.","Das Elixier sorgt f\xfcr einen unangenehmen Nebeneffekt.",B.a1,B.t,B.P,42,"alchimie")
B.wy=new A.ay("TAL_44","Boote & Schiffe","Der Held nutzt g\xfcnstige Str\xf6mungen und Winde, um doppelt so schnell voranzukommen wie \xfcblich.","Der Held f\xe4llt von Bord oder ein wichtiger Teil des Wasserfahrzeugs wurde besch\xe4digt.",B.P,B.af,B.aJ,43,"booteUndSchiffe")
B.wp=new A.ay("TAL_45","Fahrzeuge","Das Fahrzeug kommt gut voran und schafft die Strecke in Rekordzeit.","Das Fahrzeug erleidet einen Achsenbruch oder f\xe4llt w\xe4hrend der Fahrt mitsamt dem Fahrer um, und der Held erleidet Fallschaden.",B.a4,B.P,B.an,44,"fahrzeuge")
B.wO=new A.ay("TAL_46","Handel","Der Held bekommt die Ware zu einem Spottpreis bzw. kann sie zu Wucherpreisen loswerden - ohne dass sein Handelspartner es ihm \xfcbel nimmt. Die Preiserh\xf6hung oder der Nachlass sollte mindestens 50 % betragen.","Der Held wird \xfcber den Tisch gezogen oder der Handelspartner weigert sich, Gesch\xe4fte mit dem Helden zu machen. Die Preiserh\xf6hung oder der Nachlass sollte mindestens 50 % betragen.",B.t,B.y,B.a4,45,"handel")
B.wP=new A.ay("TAL_47","Heilkunde Gift","Der Patient kann vollst\xe4ndig entgiftet werden, ohne dass der Held das passende Gegenmittel verwenden musste.","Der Held ordnet einen (sch\xe4dlichen) Aderlass an oder hat den Patienten bei der Behandlung verletzt oder gar zus\xe4tzlich vergiftet (1W6 SP).",B.a1,B.t,B.y,46,"heilkundeGift")
B.wk=new A.ay("TAL_48","Heilkunde Krankheiten","Der Patient ist geheilt, ohne dass der Held ein Heilmittel verwenden musste. Zudem steckt er sich nicht beim Erkrankten an.","Der Held hat dem Patienten bei der Behandlung geschadet (1W6 SP) oder der Krankheitsverlauf verschlimmert sich. Zudem besteht f\xfcr den Helden bei ansteckenden Krankheiten eine 25 % h\xf6here Chance, sich bei dem Patienten anzustecken.",B.a1,B.y,B.an,47,"heilkundeKrankheiten")
B.wn=new A.ay("TAL_49","Heilkunde Seele","Der Patient kann einen Nachteil (Angst, Pers\xf6nlichkeitsschw\xe4che oder Schlechte Eigenschaft) f\xfcr einen ganzen Tag unterdr\xfccken.","Der Held hat den Patienten bei der Behandlung verst\xf6rt oder seinem Geist anderweitig geschadet. Der Patient erh\xe4lt f\xfcr einen Tag eine Stufe des Zustands *Furcht* oder *Verwirrung*.",B.y,B.a4,B.an,48,"heilkundeSeele")
B.wf=new A.ay("TAL_50","Heilkunde Wunden","Die vollen Fertigkeitspunkte werden bei der n\xe4chsten Regenerationsphase zus\xe4tzlich zur normalen Regeneration zu den Lebenspunkten des Patienten hinzuaddiert.","Der Held hat den Patienten bei der Behandlung verletzt (1W6 SP).",B.t,B.P,B.P,49,"heilkundeWunden")
B.w7=new A.ay("TAL_51","Holzbearbeitung",u.x,u.B,B.P,B.af,B.aJ,50,"holzbearbeitung")
B.wz=new A.ay("TAL_52","Lebensmittelbearbeitung","Die Mahlzeit ist ein echter Gaumenschmaus, ein gekelterter Wein ein wirklich edler Tropfen.","Das Essen schmeckt nicht nur miserabel, der Konsum hat auch eine schwere Magenverstimmung, Durchfall oder Brechreiz (1W6 SP) zur Folge.",B.y,B.P,B.P,51,"lebensmittelbearbeitung")
B.w5=new A.ay("TAL_53","Lederbearbeitung",u.x,u.B,B.P,B.af,B.an,52,"lederbearbeitung")
B.w8=new A.ay("TAL_54","Malen & Zeichnen","Das Bild ist so gut, dass der Held f\xfcr einen ber\xfchmten Maler gehalten wird.","schreckliches, unm\xf6glich erkennbares Gekrakel",B.y,B.P,B.P,53,"malenUndZeichnen")
B.wD=new A.ay("TAL_55","Metallbearbeitung",u.x,u.B,B.P,B.an,B.aJ,54,"metallbearbeitung")
B.w0=new A.ay("TAL_56","Musizieren","Der Held spielt eine Melodie, der keiner widerstehen kann und die alle Zuh\xf6rer in ihren Bann zieht.","Schreckliche, unheilvolle T\xf6ne werden dem Musikinstrument entlockt. M\xf6glicherweise wird das Instrument dabei besch\xe4digt. Menschen suchen das Weite oder wollen dem Musikanten das Instrument entrei\xdfen.",B.a4,B.P,B.an,55,"musizieren")
B.wh=new A.ay("TAL_57","Schl\xf6sserknacken","Das Schloss springt in Rekordzeit auf. Der Held ben\xf6tigt nur die H\xe4lfte des \xfcblichen Zeitaufwandes.","Der Dietrich bricht ab, die Falle wird ausgel\xf6st oder das Schloss verklemmt sich.",B.y,B.P,B.P,56,"schloesserknacken")
